Hoy hemos tenido que cambiar los planes por la lluvia y no hemos podido salir de paseo por el entorno para celebrar San Martín.

Así que las actividades que teníamos previstas para desarrollarlas en el bosque termófilo las hemos traído al colegio para disfrutarlas igualmente.

Pablo Cobiella, bibliotecario de Breña Baja, nos ha contado unos cuentos de otoño y con la colaboración del alumnado han creado historias preciosas.

Gracias al Ayuntamiento de Breña Baja y a su concejal de cultura, Ana Trujillo , por la buena disposición y coordinación con el centro escolar.

